import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './Login';
import Dashboard from './Dashboard';
import Register from './Register'; 
import Homestudent from './Homestudent'; 
import Hometeacher from './Hometeacher';
import Forgotpassword from './Forgotpassword'; // ✅ ชื่อเดียวกับไฟล์
import Profile from './Profile'; // ✅ ชื่อเดียวกับไฟล์
import Editprofile from './Editprofile';
import Searchactivity from './Searchactivity';
import Followactivity from './Followactivity';
import Addactivity from './Addactivity';
import Checkhours from './Checkhours';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Login />} /> 
        <Route path="/homestudent" element={<Homestudent />} />
        <Route path="/checkhours" element={<Checkhours />} />
        <Route path="/hometeacher" element={<Hometeacher />} />
        <Route path="/forgotpassword" element={<Forgotpassword />} />
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="/register" element={<Register />} /> 
        <Route path="/profile" element={<Profile />} /> 
        <Route path="/editprofile" element={<Editprofile />} /> 
        <Route path="/addactivity" element={<Addactivity />} /> 
        <Route path="/searchactivity" element={<Searchactivity />} /> 
        <Route path="/followactivity" element={<Followactivity />} /> 
      </Routes>
    </Router>

  );
}

export default App;
